import React from "react";
import { NavLink } from "react-router-dom";
                                                                                                                                                                                
const Footer=()=>
{
    return(
    <>

<div className="containor" >
      <div className="row">
        <div className="col-sm-4" id="navbarColorid">
          
        
     <NavLink className="nav-link linkcolor"  to="/contact">Contact-Me </NavLink>
   
   </div>
   <div className="col-sm-4" id="navbarColorid">
        <NavLink className="nav-link linkcolor" href="/GetAdmission">How I get admission in pucit</NavLink>
    </div>
    <div className="col-sm-4" id="navbarColorid">
        <NavLink className="nav-link linkcolor" href="/GoodScore">How to score good in entry test</NavLink>
    </div>    
   
   
        
</div>
</div>




    </>
)}


export default Footer;
